import React from 'react'
import { Link } from 'react-router-dom';
import * as FaIcons from "react-icons/fa";

function Side_bar() {
    return (
        <>
            <div className="side-bar">
                <Link  to="#" className="menu_bar">
                   <FaIcons.FaBars/> 
                </Link>
            </div>
        </>
    )
}

export default Side_bar;
